import React from 'react';
import Address from './components/Address';

const Home = (props) => {

    return (
        <div className="Home">
            <Address single={this.single} emails={this.state.emails} selectAddress={this.selectAddress} selAdd={this.state.selAdd} changeName={this.changeName}/>
        </div>
    )

}

export default Home;
